Ancient Astronauts

A dedicated group of believers insist we were visited by aliens thousands of years ago and we owe our existence to them. Some of the claims are quite outrageous (cavemen were used as slaves to mine gold) while others seem more reasonable (the design of pyramids employed a surprising knowledge of astronomy). Examine the evidence that separates the science from the science fiction.

